                + genField('siteMemberId', 'mid')
                + '&url=' + encodeURIComponent(location.href.replace(/^http(s)?:\/\/(www\.)?/, ''))
                + extra
            );
        };

        function genField(name, label) {
            return wixBiSession[name] ? '&' + (label || name) + '=' + wixBiSession[name] : '';
        }
        function toBool(v) {
            return v ? '1' : '0';
        }
